import React from 'react';
import './SponsorsSection.css'; // Make sure to import your CSS file

const SponsorsSection = () => {
  const sponsorImages = [
    require('./path/to/sponsor1.png'),
    require('./path/to/sponsor2.png'),
    require('./path/to/sponsor3.png'),
    // Add more paths as needed
  ];

  return (
    <div className="sponsors-section">
      {sponsorImages.map((image, index) => (
        <img key={index} src={image.default} alt={`Sponsor ${index + 1}`} className="sponsor-image" />
      ))}
    </div>
  );
};

export default SponsorsSection;
